import React, {useState} from 'react';
import Servers from './Servers';

function SideDisplayList(props) {
    const [servers, setServers] = useState([]);

    return (
        <div className="flex flex-col justify-around">
            <div className="bg-gray-200 border-solid border-b-2 border-black"> 
                Profile
            </div> 
            <div className="bg-gray-400 border-solid border-b-2 border-black">
                {servers.map((server, index) => (
                    <Servers key ={index} server = {server}/>
                ))}
            </div>
            <div className="bg-gray-600 rounded-full text-center"> 
                <h1 className="text-3xl border-solid border-b-2 border-black">
                    +
                </h1>
            </div>



        </div>
    )
}


export default SideDisplayList;
